import React, { useState } from "react";
import axios from "axios";
import { motion } from "framer-motion";

function App() {
    const [file, setFile] = useState(null);
    const [prediction, setPrediction] = useState(null);
    const [loading, setLoading] = useState(false);

    const handleFileChange = (e) => setFile(e.target.files[0]);

    const handleUpload = async () => {
        if (!file) return alert("Please select a file first!");

        const formData = new FormData();
        formData.append("file", file);

        try {
            setLoading(true);
            setPrediction(null);

            const response = await axios.post("http://localhost:8000/predict", formData)
            .then((response) => {
                console.log("Full response data:", response.data);
                setPrediction(response.data);
            })
            .catch((error) => {
                console.error("Error uploading file:", error);
                alert("Failed to get prediction.");
            });
            console.log("Response:", response.data);

            const { classification_report, predictions } = response.data;

            setPrediction({
                report: classification_report,
                results: predictions,
            });
        } catch (error) {
            console.error("Error uploading file:", error);
            alert("Failed to get prediction.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="min-h-screen bg-gradient-to-r from-blue-500 to-purple-600 flex flex-col items-center justify-center p-4">
            <motion.h1
                initial={{ y: -20, opacity: 0 }}
                animate={{ y: 0, opacity: 1 }}
                transition={{ duration: 0.5 }}
                className="text-4xl font-extrabold mb-6 text-white drop-shadow-lg"
            >
                🌟 FedShield 🌟
            </motion.h1>

            <motion.div
                initial={{ scale: 0.9, opacity: 0 }}
                animate={{ scale: 1, opacity: 1 }}
                transition={{ duration: 0.5 }}
                className="bg-white p-6 rounded-2xl shadow-lg w-80"
            >
                <input
                    type="file"
                    onChange={handleFileChange}
                    className="w-full mb-4 p-2 border rounded"
                />
                <button
                    onClick={handleUpload}
                    className="w-full bg-gradient-to-r from-blue-500 to-purple-600 hover:opacity-90 text-white font-semibold py-2 rounded-2xl transition"
                >
                    🚀 Upload & Predict
                </button>

                {loading && (
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 0.3 }}
                        className="text-blue-500 font-semibold mt-4 text-center"
                    >
                        🔄 Processing...
                    </motion.div>
                )}

                {prediction && (
                    <motion.div
                        initial={{ scale: 0.8, opacity: 0 }}
                        animate={{ scale: 1, opacity: 1 }}
                        transition={{ duration: 0.5 }}
                        className="mt-4 p-4 bg-gray-100 text-gray-800 rounded-xl shadow-lg text-center"
                    >
                        {/* Prediction Results Table */}
                        <h2 className="text-2xl font-bold mb-4 text-green-700">✅ Prediction Results</h2>
                        <table className="table-auto w-full border-collapse border border-green-500 shadow-md">
                            <thead>
                                <tr className="bg-green-300 text-green-900">
                                    <th className="border border-green-500 px-4 py-2">Transaction</th>
                                    <th className="border border-green-500 px-4 py-2">Prediction</th>
                                </tr>
                            </thead>
                            <tbody>
                                {prediction.results.map((res, index) => (
                                    <tr
                                        key={index}
                                        className="hover:bg-green-100 transition duration-200 ease-in-out"
                                    >
                                        <td className="border border-green-500 px-4 py-2 font-medium">
                                            Transaction {index + 1}
                                        </td>
                                        <td
                                            className={`border border-green-500 px-4 py-2 font-semibold ${
                                                res === "Fraud" ? "text-red-500 bg-red-100" : "text-green-500 bg-green-100"
                                            }`}
                                        >
                                            {res}
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>

                        {/* Classification Report Table */}
                        <h2 className="text-2xl font-bold mt-6 mb-4 text-blue-700">📊 Classification Report</h2>
                        <table className="table-auto w-full border-collapse border border-blue-500 shadow-md">
                            <thead>
                                <tr className="bg-blue-300 text-blue-900">
                                    <th className="border border-blue-500 px-4 py-2">Metric</th>
                                    <th className="border border-blue-500 px-4 py-2">Class 0</th>
                                    <th className="border border-blue-500 px-4 py-2">Class 1</th>
                                    <th className="border border-blue-500 px-4 py-2">Accuracy</th>
                                </tr>
                            </thead>
                            <tbody>
                                {["precision", "recall", "f1-score", "support"].map((metric) => (
                                    <tr key={metric} className="hover:bg-blue-100 transition duration-200 ease-in-out">
                                        <td className="border border-blue-500 px-4 py-2 font-medium">{metric}</td>
                                        <td className="border border-blue-500 px-4 py-2">{prediction.report["0"][metric]}</td>
                                        <td className="border border-blue-500 px-4 py-2">{prediction.report["1"][metric]}</td>
                                        {metric === "precision" && (
                                            <td rowSpan="4" className="border border-blue-500 px-4 py-2 font-bold align-middle bg-yellow-100 text-yellow-700">
                                                {prediction.report.accuracy}
                                            </td>
                                        )}
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </motion.div>
                )}
            </motion.div>
        </div>
    );
}

export default App;
